const[searchResponse,setSearchResponse]=useState()


  return (
    <div className="app">
      <div className="app__container">
        <h1>POKEDEX</h1>
        <h1 className="app__title">Pokedex search!</h1>
        <Search setData={setSearchResponse}/>
